% Function for standard illuminants and reference spectra:
% Calculates the linear interpolated values of a given wavelength vector
% and the reference in question.
%
% usage: spec = ciespec(lambda,'reference',Y,'W')
%
% where: lamba is a vector with the wavelengths
%        'reference' is the reference in question, see list below.
%        Y (optional) specifies the V(lambda) weigthed target value(s),
%        default: none
%        'W' (optional) specifies the weighting function(s), default: 'VL'
%
%        It is possible assign multiple references in one function call by
%        using an cell array:
%
%        spec = ciespec(lambda,{'ref1','ref2',...,'refx'})
%
%        Note: the return matrix is then a row wise matrix in the same
%              order given in the reference.
%
%        reference spectra:
%        'x'   = 2 degree tristimulus function x bar
%        'y'   = 2 degree tristimulus function y bar equals V(lambda) 'VL'
%        'z'   = 2 degree tristimulus function z bar
%        'xyz' = 2 degree tristimulus functions x bar, y bar and z bar
%        'x10' = 10 degree tristimuls function x10 bar
%        'y10' = 10 degree tristimulus funtcion y10 bar
%        'z10' = 10 degree tristimulus function z10 bar
%        'xyz10' = 10 degree tristimulus functions x10 bar, y10 bar and z10 bar
%        'r'   = CIE r bar function - note: source only 380:5:780 nm
%        'g'   = CIE g bar function - note: source only 380:5:780 nm
%        'b'   = CIE b bar function - note: source only 380:5:780 nm
%        'rgb' = CIE rgb bar function - note: source only 380:5:780
%        'VL'  = V(lambda) and tristimulus function ybar 'y'
%        'V-L' = V'(lambda) equals rhodopic/scotopic 'rh'
%        'sc'  = retinal ganglion cells: s-cone-opic or cyanopic
%        'mc'  = retinal ganglion cells: m-cone-opic or chloropic
%        'lc'  = retinal ganglion cells: l-cone-opic or erythropic
%        'rh'  = retinal ganglion cells: rhodopic or scotopic equals V'(lambda) 'V-L'
%        'mel' = retinal ganglion cells: melanopic
%        'a-opic' = retinal ganglion cells: s,m,l-cone, rh and mel
%        'BLH' = Blue Light Hazard function
%        'CRI' = coulor rendering index reference data (14 probes)
%        'CFI' = colour fidelity index reference data (99 probes)
%
%        standard illuminants:
%        'A' = standard illuminant A
%        'C' = not official standard illuminant C
%        'D65' = standard illuminant daylight 6500 K
%        'D50' = illuminant daylight 5000 K - D65 recommended
%        'D55' = illuminant daylight 5500 K - D65 recommended
%        'D75' = illuminant daylight 7500 K - D65 recommended
%        'E' = equi energy illuminant - all wavelengths have value 1
%        'FL1'  = standard illuminant FL1: standard flourescent lamp
%        'FL2'  = standard illuminant FL2: standard flourescent lamp recommended
%        'FL3'  = standard illuminant FL3: standard flourescent lamp
%        'FL4'  = standard illuminant FL4: standard flourescent lamp
%        'FL5'  = standard illuminant FL5: standard flourescent lamp
%        'FL6'  = standard illuminant FL6: standard flourescent lamp
%        'FL7'  = standard illuminant FL7: broadband flourescent lamp recommended
%        'FL8'  = standard illuminant FL8: broadband flourescent lamp
%        'FL9'  = standard illuminant FL9: broadband flourescent lamp
%        'FL10' = standard illuminant FL10: narrow band flourescent lamp
%        'FL11' = standard illuminant FL11: narrow band flourescent lamp recommended
%        'FL12' = standard illuminant FL12: narrow band flourescent lamp
%        'FL3.1' = standard illuminant FL3.1: standard halophosphat lamp
%        'FL3.2' = standard illuminant FL3.2: standard halophosphat lamp
%        'FL3.3' = standard illuminant FL3.3: standard halophosphat lamp
%        'FL3.4' = standard illuminant FL3.4: DeLuxe type lamp
%        'FL3.5' = standard illuminant FL3.5: DeLuxe type lamp
%        'FL3.6' = standard illuminant FL3.6: DeLuxe type lamp
%        'FL3.7' = standard illuminant FL3.7: three band fluorescent lamp
%        'FL3.8' = standard illuminant FL3.8: three band fluorescent lamp
%        'FL3.9' = standard illuminant FL3.9: three band fluorescent lamp
%        'FL3.10' = standard illuminant FL3.10: three band fluorescent lamp
%        'FL3.11' = standard illuminant FL3.11: three band fluorescent lamp
%        'FL3.12' = standard illuminant FL3.12: multi band fluorescent lamp
%        'FL3.13' = standard illuminant FL3.13: multi band fluorescent lamp
%        'FL3.14' = standard illuminant FL3.14: multi band fluorescent lamp
%        'FL3.15' = standard illuminant FL3.15: D65 simulator lamp
%        'HP1' = standard illuminant HP1: standard high pressure sodium lamp
%        'HP2' = standard illuminant HP2: colour enhanced high pressure sodium lamp
%        'HP3' = standard illuminant HP3: standard high pressure metal halide lamp
%        'HP4' = standard illuminant HP4: standard high pressure metal halide lamp
%        'HP5' = standard illuminant HP5: standard high pressure metal halide lamp
%        'LED-B1' = Phosphor-type LED
%        'LED-B2' = Phosphor-type LED
%        'LED-B3' = Phosphor-type LED
%        'LED-B4' = Phosphor-type LED
%        'LED-B5' = Phosphor-type LED
%        'LED-BH1' = Hybrid-type LED
%        'LED-RGB1' = RGB-type LED
%        'LED-V1' = violet pumped phosphor-type LED
%        'LED-V2' = violet pumped phosphor-type LED
%        'W' = spectral window transmitance for indoor daylight illuminants
%
%        none standard illuminants:
%        'DXX'    = daylight with XX00 CCT 
%        'DXXXX'  = daylight with XXXX CCT
%        'BBXX'   = black body radiator with XX00 K
%        'BBXXXX' = black body radiator with XXXX K
%
%        reference sources:
%        ISO/CIE 11664-1:2019(E): Colorimetry - Part 1: CIE standard colorimetric observers. Commission International d’Eclairage (CIE), Vienna Austria, 2019.
%        https://cie.co.at/publications/colorimetry-part-1-cie-standard-colorimetric-observers-0
%        
%        ISO/CIE 11664-2:2022(E): Colorimetry - Part 2: CIE standard illuminants. Commission International d(Eclairage (CIE), Vienna Austria, 2007.
%        https://cie.co.at/publications/colorimetry-part-2-cie-standard-illuminants-0
%
%        CIE 15:2018: Colorimetry, 4th Edition. Commission Internationale de l'Eclairage (CIE), Vienna Austria, 2018, ISBN: 978-3-902842-13-8 , (DOI: 10.25039/TR.015.2018).
%        https://cie.co.at/publications/colorimetry-4th-edition
%
%        CIE S 026/E:2018: CIE System for Metrology of Optical Radiation for ipRGC-Influenced Responses to Light. Commission Internationale de l'Eclairage, Vienna Austria, 2018, (DOI: 10.25039/S026.2018).
%        https://cie.co.at/publications/cie-system-metrology-optical-radiation-iprgc-influenced-responses-light-0
%
%        IEC 62471:2006/CIE S 009:2002: Photobiological safety of lamps and lamp systems / Sécurité photobiologique des lampes et des appareils utilisant des lampes (bilingual edition). Commission Internationale de l'Eclairage (CIE), Vienna Austria, 2002.
%        https://cie.co.at/publications/photobiological-safety-lamps-and-lamp-systems-s-curit-photobiologique-des-lampes-et-des
%
%        CIE 224:2017: CIE 2017 Colour Fidelity Index for accurate scientific use. Commission International d'Eclairage (CIE), Vienna Austria, 2017, ISBN: 978-3-902842-61-9.
%        https://cie.co.at/publications/cie-2017-colour-fidelity-index-accurate-scientific-use
%
%        CIE 13.3:1995: Method of measuring and specifying colour rendering properties of light sources. Commission Internationale de l'Eclairage (CIE), Vienna Austria, 1995, ISBN: 978 3 900734 57 2.
%        https://cie.co.at/publications/method-measuring-and-specifying-colour-rendering-properties-light-sources
% 
%        The reference data is sourced from the the Commission International
%        d’Eclairage (CIE - International Commission on Illumination) and
%        permission to use the data in the Lighting Toolbox was granted. 
%        Any errors in the data set or in results generated with the Lighting
%        Toolbox are not in the liability of the CIE nor me, see licence.
%
% Author: Frederic Rudawski
% Date: 25.09.2019 - last edited: 30.05.2021 (Sunday)
% See: https://www.frudawski.de/ciespec

function spec = ciespec(lambda,reference,Y,W)

% check input
if ~exist('Y','var')
    Y = [];
end
if ~exist('W','var')
    W = 'VL';
end

% get referrence spectra
type = whos('reference');
if isequal('cell',type.class)
    spec = zeros(size(reference,2),size(lambda,2));
    ind = 1;
    for i = 1:size(reference,2)
        switch reference{i}
            case 'a-opic'
                spec(ind:ind+4,:) = spectrum(lambda,reference{i});
                ind = ind+5;
            case 'aopic'
                spec(ind:ind+4,:) = spectrum(lambda,reference{i});
                ind = ind+5;
            case 'xyz'
                spec(ind:ind+2,:) = spectrum(lambda,reference{i});
                ind = ind+3;
            case 'xyz10'
                spec(ind:ind+2,:) = spectrum(lambda,reference{i});
                ind = ind+3;
            case 'rgb'
                spec(ind:ind+2,:) = spectrum(lambda,reference{i});
                ind = ind+3;
            otherwise
                spec(ind,:) = spectrum(lambda,reference{i});
                ind = ind+1;
        end
    end
else
    spec = spectrum(lambda,reference);
end

% weight spectra
if ~isempty(Y)
    F = ciespec2unit(lambda,spec,W);
    % in case of different weighting functions
    if size(F,2) > 1
        F = diag(F);
    end
    % weighting factor
    f = Y'./F;
    % weight spectra with factor
    spec = spec.*repmat(f,1,length(lambda));
end


